import React from 'react'
import { Link } from 'react-router-dom'
import styled from "styled-components";

const Header = () => {

    const handleClick = () => {
        localStorage.clear();
    }

    return (
        <Wrapper>
            <Logo>Drummy</Logo>
            <Link to='/'
            onClick={handleClick}
            >
                Log Out
            </Link>
        </Wrapper>

    )
}

export default Header

const Wrapper = styled.div`
display: flex;
justify-content: space-between;
align-items: center;
min-width: 900px;
height: 5vh;
border: 3px solid black;
`

const Logo = styled.p`
margin-left: 15px;
`
